(1, 'https://www.facebook.com/drnizamhealthbd/', 'https://twitter.com/drnizamhealthbd', 'https://www.youtube.com/channel/UCQgc3B7YoY6q0Ag8roeF-Qg', 'https://www.facebook.com/', 'https://www.facebook.com/', 'https://www.linkedin.com/in/nizamhealthbd/', '+ 880-171-301638', 'nizam1016@gmail.com', 'Saturday - Thursday<br>09:00 am - 5:00pm', 'Road # 1, House # 38, Green Haven, \r\nBanani, Old DOHS, Dhaka-1206, \r\nBangladesh', 'Greetings from Dr Nizam Uddin Ahmed', 'Dr. Ahmed is a renowned public health and management professional with a strong professional experiences in digital health services, strategic planning, program design, implementation, partnership & capacity building, resource mobilization and policy advocacy with Government, NGOs, private sectors. He is working over 30 years in national and international settings with international NGOs, UN Agencies, Government & private sector both in Bangladesh and international assignments with varieties of cross-cultural settings in South and Central Asia. He has provided leadership in health sector including maternal, child health & new-born health (MNCH), Sexual & Reproductive health, Family Planning, HIV/AIDS, Nutrition program & utilization of Digital Health services. He has proven experiences in implementing nationawide digital health services, program development, performance based framework, fund raising & working with Government health systems.', '© 2021  Dr Nizam Uddin Ahmed All Rights Reserved', '1644403246-74607502.png', '1592972561-71319159.zip');
